export const Checkbox = React.forwardRef(({ onClick, ...rest }, ref) => {
    return (
      <>
        <button
          ref={ref}
          onClick={onClick}
          {...rest}
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        >
          Select
        </button>
      </>
    );
